 "31": ["Всем рекомендую! Рыба крутая, кот в восторге! Есть куда выплеснуть негативную энергию.\nНе ожидала, что игрушка будет такой большой, примерно со среднюю женскую ладонь. Заряжается от micro-USB, провод в комплекте. Моторчик вынимается из рыбы через отверстие на молнии. Это большой плюс - игрушку можно постирать, не боясь испортить механизм.\nСталю 5 звёзд, жаль, что нельзя поставить 10)", "2021-03-03T17:04:41Z", "белый, темно-синий", "0", 2, 1, 5, "Игрушки для кошек рыба электрическая", "bestsmile"], "32": ["Не работает механизм.", "2021-02-22T14:35:59Z", "белый, краплак красный", "0", 2, 1, 1, "Игрушки для кошек рыба электрическая", "bestsmile"], "33": ["На фото рыба красивее. У меня кривая-косая с неверно прошитой головой. В пакете только рыба, кабеля нет. Внутри неё нет пакета с мятой (валерьянкой... что на фото изображена). \nРаботает очень громко. 4 кота и все ее боятся. ", "2021-02-06T08:43:50Z", "кирпично-красный, белый", "0", 6, 4, 3, "Игрушки для кошек рыба электрическая", "bestsmile"], "34": ["Начитавшись отзывов, захотелось порадовать свою кошечку. К сожалению рыбка не рабочая, хвостиком не шевелит, заряжала целую ночь- бесполезно!!!!!!!ПЕЧАЛЬ!!!!", "2021-02-05T08:27:37Z", "белый, темно-синий", "0", 4, 1, 1, "Игрушки для кошек рыба электрическая", "bestsmile"], "35": ["Сделана хорошо. Но больно уж шумный моторчик. Кот остался равнодушен к игрушке. ", "2021-02-02T13:46:06Z", "белый, темно-синий", "0", 1, 0, 4, "Игрушки для кошек рыба электрическая", "bestsmile"], "36": ["Коты её боятся", "2021-02-01T13:40:24Z", "кирпично-красный, белый", "0", 2, 1, 4, "Игрушки для кошек рыба электрическая", "bestsmile"], "37": ["Рыба крутая,стала лучшем другом нашей кошки ,активно дрыгается, мы восторге. Комплект получи весь,спасибо.", "2021-01-30T08:13:29Z", "кирпично-красный, белый", "0", 2, 0, 5, "Игрушки для кошек рыба электрическая", "bestsmile"], "38": ["Не работает! Очень не довольны покупкой!", "2021-01-29T09:21:04Z", "белый, краплак красный", "0", 0, 1, 1,